const PhoneInput = () => {
    return (
        <div>
            <input placeholder='-없이 전화번호를 입력해주세요' className='w-[200px] text-[12px] py-2 px-2 border focus:outline-none hover:outline-none hover:border-[#19C4D8]'  type='text' />
        </div>
    )
}
export default PhoneInput;
